import React from "react";
import VideoCard from "./VideoCard";
import blog from "../videos"

export default function Content(){
    const blogs = blog.map(items=>{
        return <BlogCard key={items.id} item={items} />
    })
    return(
        <div className="main-items">
        <h1 data-aos = "fade-up">My Contents</h1>
        <div className="blog-container">
            {blogs}
        </div>
        </div>
    )
}
